export function genFields(mlbStats) {
    if (mlbStats == null) return {"stats": [], "info": []}
    let stats = []
    let info = []
    mlbStats.map(team => {
        console.log(Object.entries(team.team))
        Object.entries(team.team).map(keyValue => {
            stats = ["hi"]
            stats.concat(keyValue[0])
            console.log(keyValue)
        })
    })
    console.log(stats)

    return {"stats": stats, "info": info}
}
